Commit 3d6a89e introduced the concept of private field that can not be evaluated on an Angular expression for security reasons.

This PR allows changing the pattern that matches a field as private. It also allows disabling the private field access restriction.

Some examples:
```js
myModule.config(function($parseProvider) {
  // disable private fields restriction
  $parseProvider.restrictFieldsMatching(null);
});
```


```js
myModule.config(function($parseProvider) {
  // Now private fields will be those beginning with 'priv'
  $parseProvider.restrictFieldsMatching(/^priv/);
});
```

Custom private fields allow backwards compatibility with AngularJS <1.2 projects that use underscores in scope fields (i.e. data retrieved from a MongoDB instance) while still enjoying the new private field security policy.

Closes #4509

Disallowing evaluation of private fields in Angular expressions should be toggleable through a `config()` block.  Usage is shown in ngdoc comments.

It's worth noting that this behavior defaults to FALSE.  

That is to say, if you want pre-Angular-1.2 behavior, you must do:

```javascript
myModule.config(function($parseProvider) {
  $parseProvider.allowPrivateFields(true);
});
```

Please let me know if the unit tests are insufficient; they do not consider multiple "formats" of private variables as the tests do in 3d6a89e8888b14ae5cb5640464e12b7811853c7e, but the main intent here was to show that the toggle works.

@frankhuster / @niargh has brought up an issue with using the `$index` of a repeated element for the name attribute of a form input.

I don't know how common of a use-case it is, but it seems not especially harmful to do a one-time interpolation in post-link.

It shouldn't be a breaking change unless people are using interpolation markers in their names.

While using a custom directive that uses a Date for the underlying model, I found out that when $setViewValue is called, Angular decides on whether to call the ngChange listeners via a simple comparison:

    if (this.$modelValue !== value)

Unfortunately, this doesn't work if the model is a Date - javascript doesn't properly compare two identical Date objects:

    $ node
    var a = new Date(0);
    var b = new Date(0);
    a !== b
    (prints true)

So I had to add the following patch that checks whether the model is a Date or not - and if it is, it uses the "proper" way to compare Dates in javascript, namely... casting via "+".

I hope this gets accepted - I wasted quite some time tracking this, no need for anyone else to pay the same price...
